import React, { useState, useRef } from 'react';

const WrestlingWebsite = () => {
    const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

    // Refs for scrolling to sections
    const homeRef = useRef(null);
    const shopRef = useRef(null);
    const latestNewsRef = useRef(null);

    const scrollToSection = (ref) => {
        ref.current?.scrollIntoView({ behavior: 'smooth' });
        setIsMobileMenuOpen(false);
    };

    const handleMediaKitDownload = () => {
        const link = document.createElement('a');
        link.href = '/path-to-your-mediakit.pdf';
        link.download = 'BURNITDOWNYT-MediaKit.pdf';
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
        setIsMobileMenuOpen(false);
    };

    // Safe icon components using Unicode/HTML entities
    const MenuIcon = () => <span style={{fontSize: '20px'}}></span>;
    const CloseIcon = () => <span style={{fontSize: '20px'}}></span>;
    const UserIcon = () => <span style={{fontSize: '18px'}}></span>;
    const ShoppingBagIcon = () => <span style={{fontSize: '18px'}}></span>;

    const NavLinks = ({ isMobile = false, onItemClick }) => (
        <nav className={isMobile ? 'mobile-nav' : 'desktop-nav'}>
            <button onClick={() => onItemClick ? onItemClick(homeRef) : scrollToSection(homeRef)} className="nav-link">
                Home
            </button>
            <button onClick={() => onItemClick ? onItemClick(shopRef) : scrollToSection(shopRef)} className="nav-link">
                Shop
            </button>
            <button onClick={() => onItemClick ? onItemClick(latestNewsRef) : scrollToSection(latestNewsRef)} className="nav-link">
                Latest News
            </button>
            <button onClick={handleMediaKitDownload} className="nav-link">
                Media Kit
            </button>
            <button onClick={() => console.log('Contact Us clicked')} className="nav-link">
                Contact Us
            </button>
        </nav>
    );

    return (
        <>
            <style>{`
                * {
                    margin: 0;
                    padding: 0;
                    box-sizing: border-box;
                }

                body {
                    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
                    background-color: #000;
                    color: white;
                    line-height: 1.6;
                }

                .container {
                    min-height: 100vh;
                    background-color: #000;
                }

                /* Discount Banner */
                .discount-banner {
                    background-color: black;
                    color: white;
                    text-align: center;
                    padding: 0.5rem;
                    font-size: 0.85rem;
                    font-weight: 500;
                }

                .discount-banner .discount-icon {
                    margin-right: 0.5rem;
                }

                /* Header Styles */
                .header {
                    background-color: white;
                    border-bottom: 1px solid #e0e0e0;
                    padding: 0.8rem 0;
                    position: sticky;
                    top: 0;
                    z-index: 1000;
                }

                .header-content {
                    max-width: 1400px;
                    margin: 0 auto;
                    padding: 0 1rem;
                    display: flex;
                    justify-content: space-between;
                    align-items: center;
                    back-ground-color: white;
                }

                .logo {
                    font-size: 1.4rem;
                    font-weight: bold;
                    color: #000;
                    text-decoration: none;
                }

                .desktop-nav {
                    display: none;
                    gap: 2.5rem;
                    backgroun-color: white;
                }

                .nav-link {
                    background: none;
                    border: none;
                    color: Black;
                    background-color: white;
                    text-decoration: none;
                    font-size: 0.9rem;
                    cursor: pointer;
                    padding: 0.5rem 0;
                    font-weight: 500;
                    transition: color 0.3s;
                }

                .nav-link:hover {
                    color: #000;
                }

                .header-right {
                    display: none;
                    align-items: center;
                    gap: 1.2rem;
                    background-color: white;
                }

                .header-icon {
                    color: #333;
                    cursor: pointer;
                    padding: 0.5rem;
                    border-radius: 4px;
                    transition: background-color 0.3s;
                }

                .header-icon:hover {
                    background-color: #f5f5f5;
                }

                .mobile-menu-btn {
                    background: none;
                    border: none;
                    color: #333;
                    cursor: pointer;
                    padding: 0.5rem;
                }

                /* Mobile Menu */
                .mobile-menu {
                    position: fixed;
                    top: 0;
                    left: 0;
                    right: 0;
                    bottom: 0;
                    background-color: rgba(255, 255, 255, 0.98);
                    z-index: 2000;
                    padding: 2rem;
                    display: flex;
                    flex-direction: column;
                }

                .mobile-menu-header {
                    display: flex;
                    justify-content: space-between;
                    align-items: center;
                    margin-bottom: 2rem;
                }

                .mobile-menu-header .logo {
                    color: #000;
                }

                .mobile-nav {
                    display: flex;
                    flex-direction: column;
                    gap: 1.5rem;
                }

                .mobile-nav .nav-link {
                    font-size: 1.1rem;
                    padding: 1rem 0;
                    border-bottom: 1px solid #e0e0e0;
                    text-align: left;
                    color: #333;
                }

                .close-btn {
                    background: none;
                    border: none;
                    color: #333;
                    cursor: pointer;
                    padding: 0.5rem;
                }

                /* Hero Section */
                .hero {
                    background: #000;
                    padding: 2rem 0;
                    text-align: center;
                    position: relative;
                }

                .hero-content {
                    max-width: 1400px;
                    margin: 0 auto;
                    padding: 0 1rem;
                }

                .hero-logo {
                    width: 100%;
                    max-width: 800px;
                    height: 400px;
                    margin: 0 auto;
                    background-color: #111;
                    border-radius: 8px;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    color: #666;
                    font-size: 1rem;
                }
                    .hero-logo img {
                    width: 100%;
                    height: 100%;
                    object-fit: cover;
                    object-position: center;
                }

                .tickets-btn {
                    position: absolute;
                    top: 2rem;
                    right: 2rem;
                    background-color: #fff;
                    color: #000;
                    border: none;
                    padding: 0.7rem 1.2rem;
                    border-radius: 4px;
                    font-weight: 600;
                    cursor: pointer;
                    transition: transform 0.2s;
                    font-size: 0.9rem;
                }

                .tickets-btn:hover {
                    transform: translateY(-1px);
                }

                /* Latest News Section */
                .latest-news {
                    padding: 3rem 0;
                    background-color: #f8f9fa;
                }

                .section-container {
                    max-width: 1400px;
                    margin: 0 auto;
                    padding: 0 1rem;
                }

                .section-title {
                    font-size: 1.8rem;
                    margin-bottom: 2rem;
                    color: #000;
                    font-weight: 600;
                }

                .news-grid {
                    display: grid;
                    grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
                    gap: 1.5rem;
                }

                .news-card {
                    background-color: #fff;
                    border-radius: 8px;
                    overflow: hidden;
                    box-shadow: 0 2px 8px rgba(0,0,0,0.1);
                    transition: transform 0.3s, box-shadow 0.3s;
                    cursor: pointer;
                }

                .news-card:hover {
                    transform: translateY(-4px);
                    box-shadow: 0 4px 16px rgba(0,0,0,0.15);
                }

                .news-image {
                    width: 100%;
                    height: 100%;
                    height: 180px;
                    background-color: #f0f0f0;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    color: #999;
                    font-size: 0.85rem;
                    border-bottom: 1px solid #e0e0e0;
                }

                .news-content {
                    padding: 1.2rem;
                }

                .news-label {
                    background-color: #4CAF50;
                    color: white;
                    padding: 0.25rem 0.6rem;
                    border-radius: 12px;
                    font-size: 0.75rem;
                    font-weight: 600;
                    display: inline-block;
                    margin-bottom: 0.7rem;
                    text-transform: uppercase;
                }

                .news-title {
                    font-size: 1rem;
                    margin: 0;
                    line-height: 1.4;
                    color: #000;
                    font-weight: 600;
                }

                /* Shop Section */
                .shop {
                    padding: 3rem 0;
                    background-color: #fff;
                }

                .shop .section-title {
                    color: #000;
                }

                .shop-grid {
                    display: grid;
                    grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
                    gap: 2rem;
                    margin-bottom: 3rem;
                }

                .product-card {
                    background-color: #fff;
                    border: 1px solid #e0e0e0;
                    border-radius: 8px;
                    overflow: hidden;
                    transition: transform 0.3s, box-shadow 0.3s;
                    cursor: pointer;
                }

                .product-card:hover {
                    transform: translateY(-4px);
                    box-shadow: 0 4px 16px rgba(0,0,0,0.15);
                }

                .product-image {
                    width: 100%;
                    height: 220px;
                    background-color: #f8f9fa;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    color: #999;
                    position: relative;
                    border-bottom: 1px solid #e0e0e0;
                    font-size: 0.85rem;
                }

                .hot-badge {
                    position: absolute;
                    top: 12px;
                    left: 12px;
                    background-color: #FF5722;
                    color: white;
                    padding: 0.3rem 0.7rem;
                    border-radius: 12px;
                    font-size: 0.75rem;
                    font-weight: 600;
                    text-transform: uppercase;
                }

                .product-info {
                    padding: 1.2rem;
                }

                .product-title {
                    font-size: 1rem;
                    margin-bottom: 0.7rem;
                    line-height: 1.4;
                    color: #000;
                    font-weight: 500;
                }

                .product-price {
                    color: #000;
                    font-weight: 600;
                    font-size: 1.1rem;
                }



                /* Brand Highlights */
                .brand-highlights {
                    padding: 3rem 0;
                    background-color: #f8f9fa;
                }

                .brand-highlights .section-title {
                    color: #000;
                    text-align: center;
                }

                .brand-subtitle {
                    color: #666;
                    text-align: center;
                    margin-bottom: 2rem;
                    font-size: 1rem;
                }

                .highlights-grid {
                    display: grid;
                    grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
                    gap: 2rem;
                    margin-top: 2rem;
                }

                .highlight-card {
                    background-color: #fff;
                    border: 1px solid #e0e0e0;
                    border-radius: 8px;
                    padding: 2rem;
                    text-align: center;
                    transition: transform 0.3s, box-shadow 0.3s;
                    cursor: pointer;
                }

                .highlight-card:hover {
                    transform: translateY(-4px);
                    box-shadow: 0 4px 16px rgba(0,0,0,0.15);
                }

                .highlight-icon {
                    width: 80px;
                    height: 80px;
                    background-color: #f8f9fa;
                    margin: 0 auto 1rem;
                    border-radius: 8px;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    color: #999;
                    font-size: 0.85rem;
                    border: 1px solid #e0e0e0;
                }

                /* Footer */
                .footer {
                    background-color: #000;
                    padding: 3rem 0 1rem;
                    color: #fff;
                }

                .footer-content {
                    max-width: 1400px;
                    margin: 0 auto;
                    padding: 0 1rem;
                }

                .footer-nav {
                    display: flex;
                    flex-direction: column;
                    gap: 1rem;
                    margin-bottom: 2rem;
                    align-items: center;
                }

                .footer-nav .nav-link1 {
                    color: #ccc;
                    font-size: 0.9rem;
                    padding: 0.7rem 0;
                    width: 100%;
                    text-align: center;
                    border-bottom: 1px solid #333;
                    background-color: black;
                    transition: color 0.3s, background-color 0.3s;
                }

                .footer-nav .nav-link1:hover {
                    color: #fff;
                    background-color: black;
                }

                .social-icons {
                    display: flex;
                    justify-content: center;
                    gap: 1rem;
                    margin-bottom: 2rem;
                }

                .social-icon {
                    width: 40px;
                    height: 40px;
                    background-color: #333;
                    border-radius: 50%;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    color: #fff;
                    text-decoration: none;
                    transition: background-color 0.3s;
                    font-size: 1.1rem;
                }

                .social-icon:hover {
                    background-color: #555;
                }

                .footer-text {
                    color: #666;
                    font-size: 0.85rem;
                    text-align: center;
                }

                /* Responsive Design */
                @media (min-width: 768px) {
                    .mobile-menu-btn {
                        display: none;
                    }

                    .desktop-nav, .header-right {
                        display: flex;
                    }

                    .tickets-btn {
                        position: static;
                        margin-top: 2rem;
                    }

                    .hero-content {
                        padding: 0 2rem;
                    }

                    .footer-nav {
                        flex-direction: row;
                        justify-content: center;
                        flex-wrap: wrap;
                        gap: 2.5rem;
                        background-color: black;
                    }

                    .footer-nav .nav-link1 {
                        width: auto;
                        border-bottom: none;
                        padding: 0.5rem 0;
                        background-color: black;
                    }

                    .footer-nav .nav-link1:hover {
                        background-color: black;
                        color: #fff;
                    }
                }

                @media (min-width: 1024px) {
                    .news-grid {
                        grid-template-columns: repeat(4, 1fr);
                    }

                    .shop-grid {
                        grid-template-columns: repeat(4, 1fr);
                    }

                    .highlights-grid {
                        grid-template-columns: repeat(4, 1fr);
                    }
                }
            `}</style>

            <div className="container">
                {/* Discount Banner */}
                <div className="discount-banner">
                    <span className="discount-icon"></span>
                    10% off storeLimited time!
                </div>

                {/* Header */}
                <header className="header">
                    <div className="header-content">
                        <a href="#" className="logo">BURNITDOWNYT</a>

                        <NavLinks />

                        <div className="header-right">
                            <div className="header-icon">
                                <UserIcon />
                            </div>
                            <div className="header-icon">
                                <ShoppingBagIcon />
                            </div>
                        </div>

                        <button 
                            className="mobile-menu-btn"
                            onClick={() => setIsMobileMenuOpen(true)}
                        >
                            <MenuIcon />
                        </button>
                    </div>
                </header>

                {/* Mobile Menu */}
                {isMobileMenuOpen && (
                    <div className="mobile-menu">
                        <div className="mobile-menu-header">
                            <span className="logo">BURNITDOWNYT</span>
                            <button 
                                className="close-btn"
                                onClick={() => setIsMobileMenuOpen(false)}
                            >
                                <CloseIcon />
                            </button>
                        </div>
                        <NavLinks isMobile={true} onItemClick={scrollToSection} />
                    </div>
                )}

