                                    <span className="news-label">NEW</span>
                                    <h3 className="news-title">THE UNDERTAKER TO JOIN WWE CREATIVE TEAM</h3>
                                </div>
                            </div>

                            <div className="news-card">
                                <div className="news-image">
                                    [Place WWE Super Bowl Trademark Image - Shows "WWE HAS FILED TRADEMARK FOR NEW FLEX" text]
                                </div>
                                <div className="news-content">
                                    <span className="news-label">NEW</span>
                                    <h3 className="news-title">WWE HAS FILED TRADEMARK FOR NEW PLEX</h3>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>

                {/* Shop Section */}
                <section ref={shopRef} className="shop">
                    <div className="section-container">
                        <h2 className="section-title">Shop</h2>
                        <div className="shop-grid">
