                                    <h3 className="product-title">WWE Undisputed Championship with John Cena side plates</h3>
                                    <div className="product-price">$799.00</div>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    <span className="hot-badge">HOT</span>
                                    [Place WWE Winged Eagle Championship Belt Image - Gold eagle design]
                                </div>
                                <div className="product-info">
                                    <h3 className="product-title">WWE Winged Eagle Championship Belt</h3>
                                    <div className="product-price">$799.00</div>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    [Place WWE Spinner Championship Belt Image with Custom Name Plate]
                                </div>
                                <div className="product-info">
                                    <h3 className="product-title">WWE Spinner Championship with Custom name plate</h3>
                                    <div className="product-price">$569.00</div>
                                </div>
                            </div>

                            <div className="product-card">
                                <div className="product-image">
                                    [Place WWE Big Gold World Heavyweight Championship Belt Image]
                                </div>
                                <div className="product-info">
                                    <h3 className="product-title">WWE Big Gold World Heavyweight Championship</h3>
                                    <div className="product-price">$799.00</div>
                                </div>
                            </div>

                            {/* Second Row */}
                            <div className="product-card">
                                <div className="product-image">
                                    [Place WWE Undisputed Championship with Custom Name Plate Image]
